                                                                                                                                                                                                                                (12,	'Форест Хиллс',	56.270786,	37.185287,	'Гольф-поле спроектировано одним из лучших архитектурных бюро Hills&Forest International Golf Course Arhitects (USA), архитекторами Стивом Форестом (Steve Forrest) и Артуром Хиллом (Arthur Hills). Название проекта полностью оправданно как фамилиями архитекторов, так и переводом на русский язык: «Лесные Холмы». Итогом работы архитекторов стало уникальное восемнадцатилуночное чемпионское гольф-поле, органично вписанное в холмистый рельеф ледникового происхождения Дмитровского района МО. Живописный природный ландшафт векового леса и равнин органично дополняют крутые обрывы, широкие овраги, озера, а также лесные речки, в которых обитает заповедная рыба хариус, добавляющая эксклюзивность данной местности. Среди всего этого великолепия и расположен наш гольф-клуб.',	18,	'2021-06-30 19:46:41.114+00',	'2021-07-05 13:18:24.246+00',	'Дмитровский район Московской области, 41-м км Рогачевского шоссе',	'+7(926)230-52-25',	NULL,	'http://www.forestgolf.ru/',	0,	2017370,	524901,	NULL,	NULL,	NULL),
                                                                                                                                                                                                                                (21,	'Carya Golf Club',	36.86546,	31.00956,	'Это чемпионское гольф-поле пролегает между соснами и эвкалиптами, через волнистые песчаные гряды с белыми бункерами. Carya - это классическое поле, уникальное для региона, с естественным культивированием вереска.. Carya Golf также предлагает своим гостям великолепный клабхаус и тренировочное поле мирового уровня. Будучи одним из самых популярных загородных клубов Турции, Carya Golf Club запустил первое полностью освещенное поле для гольфа в Европе. Все 18 лунок хорошо освещены, а это значит, что у Вас есть возможность продолжать игру даже после захода солнца и наслаждаться теплыми Турецкими ночами в полной мере.',	18,	'2021-10-29 07:37:35.072+00',	'2021-10-29 07:38:51.794+00',	'Kadriye, 07525, Taşlıburun Mevkii, 07525 Serik/Antalya',	'+902427103409',	NULL,	'http://www.caryagolf.com/',	0,	298795,	321580,	NULL,	NULL,	NULL),
                                                                                                                                                                                                                                (22,	'Tbilisi Hills',	41.65362,	44.85188,	'Гольф-клуб Tbilisi Hills расположен у подножия Кавказских гор всего в 15 минутах езды от старого Тбилиси. Гольфисты могут насладиться не только игрой на профессиональном поле c 18 лунками, но и панорамным видом на окрестности Тбилиси, гору Казбек и монастырь Шавнабада.

